import React from "react";
import "./Portfolio.css";

const Portfolio = () => {
  return (
    <>
      <section className="portfolio" id="portfolio">
        <h3>
          <span> my </span> portfolio
        </h3>
      </section>
    </>
  );
};

export default Portfolio;
